import { Bread } from './Bread';
import { MainNav } from './MainNav';
import { MainSection1 } from './Mainsection1';
import { MainSection2 } from './Mainsection2';
import { MainSection3 } from './Mainsection3';
import { MainSection4 } from './Mainsection4';
import { MainSection5 } from './Mainsection5';
import { useEffect } from 'react';
export function MainContent({mainsection}){

   const mainsectionpage=()=>{
    switch(mainsection){
      case 1: link.href = './project02/style/MainSection1.css';
        return <MainSection1/>
      case 2: link.href = './project02/style/MainSection2.css';
        return <MainSection2/>
      case 3:
        return <MainSection3/>
      case 4:
        return <MainSection4/>
      case 5:
        return <MainSection5/>

        default:
          break;
    }
   }

  return(
    <div className="main-content">
      <MainNav/>
      <Bread/>
      {mainsectionpage()}
      {/* <MainSection/> */}
  </div>
  );
}
